export function Todo({ id, userId, title, completed, completeTask }) {
    return (
      <>
            <h1>Zadanie nr {id}</h1>
                <a>id użytkownika: {userId}</a><br/>
                <a>opis: {title}</a><br/>
                <a>ukończono: {completed ? 'tak' : 'nie'}</a><br/>
                <button onClick={completeTask}>{completed ? 'wznów' : 'zakończ'}</button>
      </>
    )
  }
